    "2016-08-04T08:17:40.653821",nt"name": "alaska-peninsula-becharof-national-wildlife-refuge-complex-annual-narrative-report-calen-1-90036",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Alaska
    Peninsula and Becharof NWRs outlines Refuge accomplishments during the 1995 calendar
    year. The report begins with a summary of the year's highlights and weather conditions.
    Land acquisition is covered. The report includes a planning section which discusses
    management planning, public participation, and research and investigations. Refuge
    administration is outlined; information about personnel, youth programs, volunteer
    programs, funding, and safety is given. Habitat management is also covered; subjects
    include water rights and wilderness areas. The wildlife section of the report discusses
    waterfowl, shorebirds, raptors, game mammals, marine mammals, fisheries resources,
    and marking and bird banding. The public uses of the Refuge described in this report
    include outdoor classrooms, interpretive programs, hunting, fishing, trapping, outdoor
    recreation, and law enforcement. The equipment and facilities section of the report
    provides information about rehabilitation, major maintenance, equipment replacement,
    communication systems, computer systems, and energy conservation. Cooperative programs
    and economic uses of the Refuge are provided at the end.",nt"license_title":
